import React from "react";
import LoginRegisterForm from "../LoginRegisterForm/LoginRegisterForm";

function Login() {
  return (
    <LoginRegisterForm greetings={'Рады видеть!'} submitText={'Зарегистрироваться'} spanText={'Уже зарегистрированы?'} spanButtonText={'Войти'}
      Children={`
      <label className="login__label">Имя</label>
        <input className="login__input"
          type="text" name='name' id="name-input" autoComplete='off' minLength='2' maxLength='40' required />
        <label className="login__label" >E-mail</label>
        <input value="" autoComplete='off'
          className="login__input" type="email" id="email-input" name='email' required />`
      } />
    //     <label className="login__label">Имя</label>
    //     <input className="login__input"
    //       type="text" name='name' id="name-input" autoComplete='off' minLength='2' maxLength='40' required />
    //     <label className="login__label" >E-mail</label>
    //     <input value="" autoComplete='off'
    //       className="login__input" type="email" id="email-input" name='email' required />
    //     <button type='submit' className="register__button">Зарегистрироваться</button>
    //   </form>
    //   <span className="register__span">Уже зарегистрированы? <button className="register__bth-enter">Войти</button></span>
    // </section >
  )
}

export default Login;
